    CompanyDto company = new CompanyDto();

    private async void AddCompany()
    {
        try
        {
            await CopmanyService.Add(company);
            CompanyBack();
        }
        catch (Exception e)
        {
            toastService.ShowInfo(e.Message.ToString(), company.CompanyName);
        }




    }

    void CompanyBack()
    {
        NavigationManager.NavigateTo("/Company/List/");
    }

